import React from 'react';
import { ChakraProvider, Container, theme, Flex } from '@chakra-ui/react';

function App() {
  return (
    <ChakraProvider theme={theme}>
      <Container maxW="100%">
        <Flex spacing="3" padding="6">
          <Heading fontSize="3xl">Sumant Guha</Heading>
        </Flex>
      </Container>
    </ChakraProvider>
  );
}

export default App;
